import React, { useContext, useEffect } from 'react'
import todoContext from '../../contexts/TodoContext'
import TodoItem from './TodoItem'
const TODO = () => {
  const obj=useContext(todoContext)
  const {todos,getTodos}=obj
  useEffect(()=>{
    getTodos();
  },[])
  
  return (
    <>
      {
        todos.map(todo=>{
          return <TodoItem todo={todo} />
        })
      }
    </>
  )
}

export default TODO
